import * as React from 'react';
import Checkbox from '@mui/material/Checkbox';
import FormGroup from '@mui/material/FormGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import FormControl from '@mui/material/FormControl';
import FormLabel from '@mui/material/FormLabel';

export default function FormControlLabelPosition() {
  return (
    <FormControl component="fieldset">
      <FormLabel component="legend">Елки</FormLabel>
      <FormGroup aria-label="position" column>
        <FormControlLabel
          value="top"
          control={<Checkbox />}
          label="Литые елки"
          labelPlacement="left"
        />
         <FormControlLabel
          value="top"
          control={<Checkbox />}
          label="Уличные леки"
          labelPlacement="left"
        />
         <FormControlLabel
          value="top"
          control={<Checkbox />}
          label="Елки с лампочками"
          labelPlacement="left"
        />
         <FormControlLabel
          value="top"
          control={<Checkbox />}
          label="Заснежные елки"
          labelPlacement="left"
        />
         <FormControlLabel
          value="top"
          control={<Checkbox />}
          label="Комбинированные леки"
          labelPlacement="left"
        />
      </FormGroup>
    </FormControl>
  );
}
